import WindowSolana from './WindowSolana'

export default class Glow extends WindowSolana {

  static info = {
    name: 'Glow',
    logo: 'data:image/webp;base64,',
    blockchains: ['solana']
  }

  static isAvailable = async()=>{
    return (
      window.solana &&
      window.solana.isGlow
    )
  }
}
